import React, { useState, useRef } from 'react';
import bubble from '../img/prepop.png'
import pop from '../img/popped.png'

import './Analytics.css'

const Analytics = () => {
    let arr = [...Array(199).keys()]
    return (
        <div className="bubble-container">
            <img src={pop}></img>
            <img src={pop}></img>

            {arr.map((index) => {
                return <img src={bubble}/>
            })}
        </div>
    )

}
export default Analytics;
